import Beans from './green_beans.jpeg';
import Carbbage from './carbbage.jpg';

const itemList = [{
    id: 1005,
    name: "Carrot",
    price: 165,
    bio: "Grown in Nuwara Eliya, Sri Lanka",
    imageName: Carrot
},{
    id: 1007,
    name: "Beans",
    price: 758,
    bio: "Grown in Matale, Sri Lanka",
    imageName: Beans
},{
    id: 1009,
    name: "Cabbage",
    price: 105,
    bio: "Grown in Nuwara Eliya, Sri Lanka",
    imageName: Carbbage
},{
    id: 1004,
    name: "Pumpkin",
    price: 400,
    bio: "Grown in Yala, Sri Lanka",
    imageName: Carrot
},{
    id: 1006,
    name: "Ladies' Fingers",
    price: 400,
    bio: "Grown in Nuwara Eliya, Sri Lanka",
    imageName: Carrot
}];

function Shop() {
    return(
        <div className="shop-container">
            <Nav/>
            <Title/>
            <ShopComponent/>
        </div>
    )
}

export default Shop;
